<script>
import { watch } from "@vue/runtime-core";
export default {
    props: {
        user: {
            type: Object,
            require: true,
        },
        role: {
            type: String,
            require: true,
        },
    },
    setup(props) {
        watch(
            () => props.role,
            () => {
                if (props.role == "student") {
                    document
                        .getElementById("card")
                        .classList.add("student-theme");
                } else if (props.role == "teacher") {
                    document
                        .getElementById("card")
                        .classList.remove("student-theme");
                }
            }
        );
        return {};
    },
};
</script>

